import React from 'react';

const Feature = (props) => {
    return (
        <div className='gtp3__features-container__feature'>
            <div className='gpt3__features-container__feature-title'>
                <h1>{props.title}</h1> 
            </div>
            <div className='gtp3__features-container__feature-text'>
                {props.text}
            </div>
        </div>
    );
};

export default Feature;
